def solve(num):
    divisors = [1]
    for i in range(2, int(num/2) + 1):
        if num % i == 0:
            divisors.append(i)

    if sum(divisors) > num:
        return True
    else:
        return False

def solve(n):
    sum_divisors = 0
    for i in range(1, n):
        if n % i == 0:
            sum_divisors += i
    if sum_divisors > n:
        return True
    else:
        return False

